BEGIN TRANSACTION;
CREATE TABLE `event_common_asset_m` (
    `event_common_asset_id` INTEGER NOT NULL,
    `event_category_id` INTEGER NOT NULL,
    `event_contents_type` INTEGER NOT NULL,
    `page` INTEGER NOT NULL,
    `description_asset` TEXT NOT NULL,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`event_common_asset_id`)
);
CREATE TABLE `event_extra_reward_m` (
    `event_extra_reward_id` INTEGER NOT NULL,
    `event_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` TEXT,
    PRIMARY KEY (`event_extra_reward_id`)
);
CREATE TABLE `event_extra_reward_setting_m` (
    `event_id` INTEGER NOT NULL,
    `point_interval` INTEGER NOT NULL,
    PRIMARY KEY (`event_id`)
);
CREATE TABLE `event_live_ranking_m` (
    `event_live_ranking_id` INTEGER NOT NULL,
    `event_id` INTEGER NOT NULL,
    `rank_from` INTEGER NOT NULL,
    `rank_to` INTEGER NOT NULL,
    PRIMARY KEY (`event_live_ranking_id`)
);
CREATE TABLE `event_live_ranking_reward_m` (
    `event_live_ranking_reward_id` INTEGER NOT NULL,
    `event_live_ranking_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` TEXT,
    `image_display_flag` INTEGER NOT NULL,
    PRIMARY KEY (`event_live_ranking_reward_id`)
);
CREATE TABLE `event_m` (
    `event_id` INTEGER NOT NULL,
    `event_category_id` INTEGER NOT NULL,
    `name` TEXT NOT NULL,
    `open_date` TEXT NOT NULL,
    `start_date` TEXT NOT NULL,
    `end_date` TEXT NOT NULL,
    `close_date` TEXT NOT NULL,
    `banner_asset_name` TEXT NOT NULL,
    `banner_se_asset_name` TEXT NOT NULL,
    `result_banner_asset_name` TEXT NOT NULL,
    `description` TEXT NOT NULL,
    `member_category` INTEGER NOT NULL,
    `reward_start_date` TEXT,
    `exchange_seal_start_date` TEXT,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`event_id`)
);
CREATE TABLE `event_point_count_m` (
    `event_point_count_id` INTEGER NOT NULL,
    `event_id` INTEGER NOT NULL,
    `point_count` INTEGER NOT NULL,
    PRIMARY KEY (`event_point_count_id`)
);
CREATE TABLE `event_point_count_reward_m` (
    `event_point_count_reward_id` INTEGER NOT NULL,
    `event_point_count_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` TEXT,
    `image_display_flag` INTEGER NOT NULL,
    PRIMARY KEY (`event_point_count_reward_id`)
);
CREATE TABLE `event_point_ranking_m` (
    `event_point_ranking_id` INTEGER NOT NULL,
    `event_id` INTEGER NOT NULL,
    `rank_from` INTEGER NOT NULL,
    `rank_to` INTEGER NOT NULL,
    PRIMARY KEY (`event_point_ranking_id`)
);
CREATE TABLE `event_point_ranking_reward_m` (
    `event_point_ranking_reward_id` INTEGER NOT NULL,
    `event_point_ranking_id` INTEGER NOT NULL,
    `add_type` INTEGER NOT NULL,
    `item_id` INTEGER NOT NULL,
    `item_category_id` INTEGER,
    `amount` INTEGER NOT NULL,
    `item_option` TEXT,
    `image_display_flag` INTEGER NOT NULL,
    PRIMARY KEY (`event_point_ranking_reward_id`)
);
CREATE TABLE `event_scenario_m` (
    `event_scenario_id` INTEGER NOT NULL,
    `event_id` INTEGER NOT NULL,
    `title` TEXT,
    `title_call_asset` TEXT,
    `title_font` INTEGER,
    `chapter` INTEGER NOT NULL,
    `chapter_asset` TEXT,
    `asset_bgm_id` INTEGER NOT NULL,
    `bg_asset` TEXT,
    `open_total_event_point` INTEGER NOT NULL,
    `open_date` TEXT NOT NULL,
    `unit_id` INTEGER,
    `is_rank_max_flag` INTEGER,
    `release_tag` TEXT, `_encryption_release_id` INTEGER NULL,
    PRIMARY KEY (`event_scenario_id`)
);
CREATE TABLE `event_scenario_setting_disp_m` (
    `event_scenario_setting_disp_id` INTEGER NOT NULL,
    `event_scenario_setting_id` INTEGER NOT NULL,
    `scenario_char_effect_cd` TEXT,
    `scenario_char_asset_id` INTEGER NOT NULL,
    `display_position` INTEGER NOT NULL,
    `character_action_type` INTEGER,
    `speaker_flag` INTEGER NOT NULL,
    PRIMARY KEY (`event_scenario_setting_disp_id`)
);
CREATE TABLE `event_scenario_setting_m` (
    `event_scenario_setting_id` INTEGER NOT NULL,
    `event_scenario_id` INTEGER NOT NULL,
    `order_num` INTEGER NOT NULL,
    `asset_background_id` INTEGER,
    `character_name` TEXT,
    `scene_effect_type` INTEGER,
    `asset_voice_id` INTEGER,
    `asset_se_id` INTEGER,
    `asset_bgm_id` INTEGER,
    PRIMARY KEY (`event_scenario_setting_id`)
);
CREATE INDEX `idx_display_position` ON `event_scenario_setting_disp_m`(`event_scenario_setting_id`,`display_position`);
COMMIT;
